  const index = 0;

  return (

      <Layout>
          <div>
              SMILE
          </div>
          <Button component = {Link} to ='.\auth\auth-go'style={{height:"200px", width:"200px"}} color="secondary" variant="contained"> Member </Button>
          &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
          <Button style={{height:"200px", width:"200px"}} color="secondary" variant="contained" onClick
          ={() => console.log("Register click!")}> Register </Button>
          <br></br> <br></br> <br></br>
          <Button size="medium" color="secondary" variant="contained" disabled> Disabled </Button>
      </Layout>

  );
};

export default Main;
